        font-family: "Helvetica Neue", "Helvetica", "Arial", sans-serif;
      }

      h1 {
        color: red;
      }`}
  >
    <div className="Document">
      <h1>Hello Yannis! (Anonymis√©)</h1>
    </div>
  </InlineCss>
);

